import styled from 'styled-components';

export const PageArea = styled.div`
    form {
        backround-color: #fff;
        border-radius: 3px;
        padding:10px;
        box-shadow:0px 0px 3px #999;

        .area {
            display:flex;
            align-item:center;
            padding:10px;
        }
    }
`;
